import { Button, Input } from '@mui/material';
import React, { useState} from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    const [username, setUsername] = useState('');
    const [room, setRoom] = useState('');
    
    return (
        <div className="homeOuterContainer">
            <div className="homeInnerContainer">
                <h1 className="heading">Join a Room</h1>
                <div><Input placeholder="" className="homeInput" type="text" value={username} onChange={(event) => setUsername(event.target.value)} /></div>
                <div><Input placeholder="" className="chatInput" sx={{ mt: 20 }} type="text" value={room} onChange={(event) => setRoom(event.target.value)} /></div>
                <Link to={`/chat/${room}/${username}`}>
                    <Button className="submitButton" sx={{ mt: 20 }} color="success" variant="contained">Join Room</Button>
                </Link>
            </div>
        </div>
    )
}

export default Home;
